const videos=Array.from(document.querySelectorAll("video")),newPlaybackRate=Number(prompt("What rate do you want?"));if(!newPlaybackRate||isNaN(newPlaybackRate))throw new Error("Canceled change of playback rate");window.anySpeedPlaybackRate=newPlaybackRate;const timeWhenChanged=Date.now();for(const a of videos)a.playbackRate=newPlaybackRate,a.addEventListener("ratechange",()=>{var e=Date.now()-timeWhenChanged;a.playbackRate!=newPlaybackRate&&e<500&&(console.info("⏱ AnySpeed - This website is automatically changing the playback speed... Bypassing the defenses!"),repeatedlySpeedUp(a))});function repeatedlySpeedUp(e){e.playbackRate=window.anySpeedPlaybackRate,requestAnimationFrame(()=>repeatedlySpeedUp(e))}